/*ON LINE APP */
if (navigator.onLine) {
    var store = Ext.create('Ext.data.Store', {
        model: 'Writer.Person',
        autoLoad: true,
        autoSync: true,
        proxy: {
            type: 'ajax',
            api: {
                read: 'process/View', //'genias/app/geniasdev/view',
                create: 'process/Insert',
                update: 'process/Insert',
                destroy: '', //'genias/app/geniasdev/destroy'
            },
            reader: {
                type: 'json',
                successProperty: 'success',
                root: 'data',
                messageProperty: 'message'
            },
            writer: {
                type: 'json',
                writeAllFields: true
            },
            listeners: {
                exception: function(proxy, response, operation) {
                    Ext.MessageBox.show({
                        title: 'ERROR',
                        msg: operation.getError(),
                        icon: Ext.MessageBox.ERROR,
                        buttons: Ext.Msg.OK
                    });
                }
            }
        },
        listeners: {
            write: function(proxy, operation) {
                if (operation.action == 'destroy') {
                    main.child('#form').setActiveRecord(null);
                }
                //Ext.example.msg(operation.action, operation.resultSet.message);
            }
        }
    });
} else {
    /*OFFLINE APP*/
    var store = Ext.create('Ext.data.Store', {
        model: 'Writer.Person',
        autoLoad: true,
        autoSync: true,
        proxy: {
            type: 'localstorage',
            id: 'genias'
        },
        listeners: {
            write: function(proxy, operation) {
                if (operation.action == 'destroy') {
                    main.child('#form').setActiveRecord(null);
                }
                store.load();
                store.sync();
                //Ext.example.msg(operation.action, operation.resultSet.message);
            }
        }
    });
    /*end OFFLINE APP*/
}


var storeOffline = Ext.create('Ext.data.Store', {
    model: 'Writer.Person',
    autoLoad: true,
    autoSync: true,
    proxy: {
        type: 'localstorage',
        id: 'genias'
    },
    listeners: {
        load: function() {
            this.each(function(record) {
                //console.log("check" + JSON.stringify(record.data, null, 4)); 
                //store.add(record.data);
                Ext.Ajax.request({
                    url: 'process/Insert',
                    method: 'POST',
                    root: 'data',
                    type: 'json',
                    params: JSON.stringify(record.data, null, 4),
                    callback: function(options, success, response) {

                        var didPost = true,
                                o;

                        if (success) {
                            try {
                                o = Ext.decode(response.responseText);
                                didPost = o.success === true;
                            } catch (e) {
                                didPost = false;
                            }
                        } else {
                            didPost = false;
                        }
                    }
                });
            });
            // Sync the online store
            store.sync();
            // Remove data from offline store
            //storeOffline.removeAll();
        },
        write: function(proxy, operation) {
            if (operation.action == 'destroy') {
                store.child('#form').setActiveRecord(null);
            }
            Ext.example.msg(operation.action, operation.resultSet.message);
        }
    }
});